import React, { Component } from 'react';
import styled from 'styled-components';

export const PassoEsquerda = styled.div`
width: 100%;
video {
    float: left;
}

h3, span, a {
    float: right;
}

`;

export const PassoDireita = styled.div `
video {
    float: right;
}

h3, span, a {
    float: left;
}
`;

class PassoApasso extends Component {
    render() {
        return (
            <>
                <PassoEsquerda>
                <iframe src="https://www.youtube.com/embed/pVE92TNDwUk" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
                    <h3>asdads</h3>
                    <span>adsads</span>
                    <a href="#"></a>
                </PassoEsquerda>
                <PassoDireita></PassoDireita>
            </>
        );
    }
}

export default PassoApasso;
